DROP TABLE google_raw;
CREATE TABLE google_raw(
   ID               INTEGER  NOT NULL PRIMARY KEY 
  ,App              VARCHAR(194) NOT NULL
  ,Category         VARCHAR(19) NOT NULL
  ,Rating           VARCHAR(3) NOT NULL
  ,Reviews          VARCHAR(8) NOT NULL
  ,Size             VARCHAR(18) NOT NULL
  ,Installs         VARCHAR(14) NOT NULL
  ,Type             VARCHAR(4) NOT NULL
  ,Price            VARCHAR(8) NOT NULL
  ,`Content Rating` VARCHAR(15)
  ,Genres           VARCHAR(37) NOT NULL
  ,`Last Updated`   VARCHAR(9) NOT NULL
  ,`Current Ver`    VARCHAR(50)
  ,`Android Ver`    VARCHAR(18)
)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
